import{_ as t,c as e,o as d,a2 as r}from"./chunks/framework.Bk-UhgEh.js";const y=JSON.parse('{"title":"HTTP状态码","description":"","frontmatter":{},"headers":[],"relativePath":"Network/http-status.md","filePath":"Network/http-status.md","lastUpdated":1714236277000}'),a={name:"Network/http-status.md"},n=r('<h1 id="http状态码" tabindex="-1">HTTP状态码 <a class="header-anchor" href="#http状态码" aria-label="Permalink to &quot;HTTP状态码&quot;">​</a></h1><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>当浏览者访问一个网页时，浏览者的浏览器会向网页所在服务器发出请求。当浏览器接收并显示网页前，此网页所在的服务器会返回一个包含HTTP状态码（Status Code）的信息头用以响应浏览器的请求。</p></div><h2 id="http状态码分类" tabindex="-1">HTTP状态码分类 <a class="header-anchor" href="#http状态码分类" aria-label="Permalink to &quot;HTTP状态码分类&quot;">​</a></h2><p><strong>HTTP状态码由三个十进制数字组成，第一个十进制数字定义了状态码的类型，后两个数字没有分类的作用。HTTP状态码共分为5种类型：</strong></p><table><thead><tr><th>分类</th><th>分类描述</th></tr></thead><tbody><tr><td>1xx</td><td>信息，服务器收到请求，需要请求者继续执行操作</td></tr><tr><td>2xx</td><td>成功，操作被成功接收并处理</td></tr><tr><td>3xx</td><td>重定向，需要进一步的操作以完成请求</td></tr><tr><td>4xx</td><td>客户端错误，请求包含语法错误或无法完成请求</td></tr><tr><td>5xx</td><td>服务器错误，服务器在处理请求的过程中发生了错误</td></tr></tbody></table><h2 id="常见http状态码" tabindex="-1">常见HTTP状态码 <a class="header-anchor" href="#常见http状态码" aria-label="Permalink to &quot;常见HTTP状态码&quot;">​</a></h2><table><thead><tr><th style="text-align:center;">状态码</th><th style="text-align:center;">状态码英文名称</th><th>含义</th></tr></thead><tbody><tr><td style="text-align:center;">101 <img width="200"></td><td style="text-align:center;">Switching Protocols <img width="200"></td><td>切换协议。服务器根据客户端的请求切换协议。只能切换到更高级的协议，例如，切换到HTTP的新版本协议、WebSocket协议。</td></tr><tr><td style="text-align:center;">200</td><td style="text-align:center;">OK</td><td>请求成功。一般用于GET与POST请求</td></tr><tr><td style="text-align:center;">201</td><td style="text-align:center;">Created</td><td>已创建。成功请求并创建了新的资源</td></tr><tr><td style="text-align:center;">204</td><td style="text-align:center;">No Content</td><td>无内容。服务器成功处理，但未返回内容。在未更新网页的情况下，可确保浏览器继续显示当前文档</td></tr><tr><td style="text-align:center;">301</td><td style="text-align:center;">Moved Permanently</td><td>永久移动。请求的资源已被永久的移动到新URI，返回信息会包括新的URI，浏览器会自动定向到新URI。今后任何新的请求都应使用新的URI代替</td></tr><tr><td style="text-align:center;">302</td><td style="text-align:center;">Found</td><td>临时移动。与301类似。但资源只是临时被移动。客户端应继续使用原有URI</td></tr><tr><td style="text-align:center;">304</td><td style="text-align:center;">Not Modified</td><td>未修改。所请求的资源未修改，服务器返回此状态码时，不会返回任何资源。客户端通常会缓存访问过的资源</td></tr><tr><td style="text-align:center;">307</td><td style="text-align:center;">Temporary Redirect</td><td>临时重定向。与302类似。使用GET请求重定向</td></tr><tr><td style="text-align:center;">400</td><td style="text-align:center;">Bad Request</td><td>错误请求。客户端请求的语法错误，服务器无法理解</td></tr><tr><td style="text-align:center;">401</td><td style="text-align:center;">Unauthorized</td><td>未授权。需要身份验证后才能获取所请求的内容,类似于403错误。不同点是401错误后,只要正确输入帐号密码,验证即可通过</td></tr><tr><td style="text-align:center;">403</td><td style="text-align:center;">Forbidden</td><td>禁止访问。客户端没有权利访问所请求内容,服务器拒绝本次请求</td></tr><tr><td style="text-align:center;">404</td><td style="text-align:center;">Not Found</td><td>未找到。服务器找不到所请求的资源</td></tr><tr><td style="text-align:center;">405</td><td style="text-align:center;">Method Not Allowed</td><td>不允许使用该方法。该请求使用的方法被服务器端禁止使用</td></tr><tr><td style="text-align:center;">410</td><td style="text-align:center;">Gone</td><td>已失效。所请求的资源已经被删除</td></tr><tr><td style="text-align:center;">500</td><td style="text-align:center;">Internal Server Error</td><td>内部服务器错误。服务器遇到未知的无法解决的问题</td></tr><tr><td style="text-align:center;">502</td><td style="text-align:center;">Bad Gateway</td><td>网关错误。服务器作为网关且从上游服务器获取到了一个无效的HTTP响应</td></tr><tr><td style="text-align:center;">503</td><td style="text-align:center;">Service Unavailable</td><td>服务不可用。由于临时的服务器维护或者过载,服务器当前无法处理请求.这个状况是临时的,并且将在一段时间以后恢复</td></tr><tr><td style="text-align:center;">504</td><td style="text-align:center;">Gateway Timeout</td><td>网关超时。服务器作为网关且不能从上游服务器及时的得到响应返回给客户端</td></tr></tbody></table><h2 id="全部http状态码" tabindex="-1">全部HTTP状态码 <a class="header-anchor" href="#全部http状态码" aria-label="Permalink to &quot;全部HTTP状态码&quot;">​</a></h2><h3 id="http-response-codes" tabindex="-1"><a href="https://developer.mozilla.org/zh-CN/docs/Web/HTTP/HTTP_response_codes" target="_blank" rel="noreferrer">HTTP response codes</a> <a class="header-anchor" href="#http-response-codes" aria-label="Permalink to &quot;[HTTP response codes](https://developer.mozilla.org/zh-CN/docs/Web/HTTP/HTTP_response_codes)&quot;">​</a></h3>',9),l=[n];function s(o,i,c,h,x,T){return d(),e("div",null,l)}const p=t(a,[["render",s]]);export{y as __pageData,p as default};
